--  DDL for Table ITEM
--------------------------------------------------------
DECLARE
  nb NUMBER;
BEGIN
  SELECT count(*) INTO nb FROM user_tables 
    WHERE TABLE_NAME = 'ITEM';
  IF nb = 0 THEN
    EXECUTE IMMEDIATE 'CREATE TABLE ITEM (
      ITEM_ID NUMBER(20) ,
      RECEIPT_ID VARCHAR(20),
      ITEM_DESC VARCHAR(200),
      PRICE NUMBER NOT NULL,
      EXP_DATE DATE NOT NULL,
      QTY NUMBER NOT NULL,
      ITEM_ADDDATE DATE,
      PRIMARY KEY(ITEM_ID))';
 END IF;
END;
